import React, {Fragment} from 'react';
import TodoApp from './todo';

 const TodosApp = (props) => {
     
    return (
        <Fragment>
                 <section>
                     <h1>{props.titl}</h1>
                    {/* {
                         props.todosProps.map((todo) => <TodoApp todo={todo} key={todo.id}/>)
                    } */}
                 </section>
             </Fragment>
    );
};
export default TodosApp;
